// HasSpu applies the HasEdge predicate on the "spu" edge.
func HasSpu() predicate.SpecKey {
	return predicate.SpecKey(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(SpuTable, FieldID),
			sqlgraph.Edge(sqlgraph.M2M, true, SpuTable, SpuPrimaryKey...),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasSpuWith applies the HasEdge predicate on the "spu" edge with a given conditions (other predicates).
func HasSpuWith(preds ...predicate.Spu) predicate.SpecKey {
	return predicate.SpecKey(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(SpuInverseTable, FieldID),
			sqlgraph.Edge(sqlgraph.M2M, true, SpuTable, SpuPrimaryKey...),
		)
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.SpecKey) predicate.SpecKey {
	return predicate.SpecKey(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for _, p := range predicates {
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.SpecKey) predicate.SpecKey {
	return predicate.SpecKey(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for i, p := range predicates {
			if i > 0 {
				s1.Or()
			}
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Not applies the not operator on the given predicate.
func Not(p predicate.SpecKey) predicate.SpecKey {
	return predicate.SpecKey(func(s *sql.Selector) {
		p(s.Not())
	})
}
